import { NavLink } from "react-router-dom";
import classes from "./Navbar.module.css";
const Navbar = () => {
  return (
    <nav className={classes.nav}>
      <div className={classes.item}>
        <NavLink to="/profile" className={(isActive) ? "activeLink" : ""}>Profile</NavLink>
      </div>
      <div className={classes.item}>
        <NavLink to="/dialogs" className={(isActive) ? "activeLink" : ""}>Messages</NavLink>
      </div>
      <div className={classes.item}>
        <NavLink to="/feed" className={(isActive) ? "activeLink" : ""}>Feed</NavLink>
      </div>
    </nav>
  );
};

export default Navbar;
